// when navigating away from your angular app, the browser will show a generic warning message\n      // see http://stackoverflow.com/a/42207299/7307355\n      confirm('ATTENZIONE: Lavoro non salvato. Premi cancel per tornare indietro e salvare il lavoro, premendo OK i cambiamenti non verranno salvati.');\n  }\n}\n        \n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"components/PopupDeleteItemComponent.html":{"url":"components/PopupDeleteItemComponent.html","title":"component - PopupDeleteItemComponent","body":"\n                   \n\n\n\n\n\n  Components\n  \n  PopupDeleteItemComponent\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n        \n            Template\n        \n        \n            Styles\n        \n        \n            DOM Tree\n        \n\n\n\n    \n    File\n\n\n    src/app/controllers/popup/popup-delete-item/popup-delete-item.component.ts\n\n\n\n\n\n    \n        Implements\n    \n    \n                    OnInit\n    \n\n\n\n    Metadata\n    \n        \n\n\n\n\n\n\n\n\n\n\n\n            \n                selector\n                app-popup-delete-item\n            \n\n            \n                styleUrls\n                ./popup-delete-item.component.scss\n            \n\n\n\n            \n                templateUrl\n                ./popup-delete-item.component.html\n            \n\n\n\n\n\n\n\n\n        \n    \n\n\n    \n    Index\n    \n        \n                \n                    \n                        Properties\n                    \n                \n                \n                    \n                        \n                            \n                                    Private\n                                confirmCode\n                            \n                        \n                    \n                \n\n                \n                    \n                 